import { AppBar, IconButton, Toolbar, Typography } from "@material-ui/core";

import React from "react";

const Header = () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant="h3" component="span" 
        sx={{}}
        >
          Test Builder
        </Typography>
        <IconButton>
          <span>Go to Home</span>
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
